contracts/SC_Agreement.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;
import "./SC_DataUsage.sol";
import "./Lib.sol";

/** 
* Actor use some data of a User Subject, generate the smart contract
 */
contract AgreementContract {

    address private creator;
    address private dataUsageContractAddress;
    DataUsageContract private dataUsageContract;
    mapping(uint => Vote) private votes;

    
    // event for EVM logging
    event UserVote(address indexed userAddress, uint indexed usageID, DataUsage dataUsage, bool consent);
    
    /**
     * @dev generate a new contract
     */
    constructor(address _dataUsageContractAddress) {
        creator = msg.sender;
        dataUsageContractAddress = _dataUsageContractAddress; // 'msg.sender' is sender of current call, contract deployer for a constructor
        dataUsageContract = DataUsageContract(dataUsageContractAddress);
    }

    /**
     * @dev get the current contract address
     */
    function getContractAddress() public view returns (address) {
        return address(this);
    }

    /**
     * @dev The Retrieve function uses the address of a GDPR compliance contract to provide a data subject information recorded by an actor in the Blockchain
     */
    function retrieveVote(uint usageID) public view returns (Vote memory) {
        return votes[usageID];
    }

    /**
     * @dev submits a data subject’s votes (positive/negative consent) to the Blockchain
     */
    function vote(uint usageID, bool consent) public {
        
        // Retrieve dataUsage from the DataUsageContract
        DataUsage memory dataUsage = dataUsageContract.retrieveDataUsage(usageID);

        require (dataUsage.userAddress != address(0x0), "Can't find this data usage record with the usageID");
        require (msg.sender == dataUsage.userAddress, "The user doesn't belong to this data usage record");
        // require (votes[usageID].userAddress != address(0x0), "User have already vote for this data usage!");

        votes[usageID] = Vote(dataUsage.actorAddress, msg.sender, usageID, consent);

        // Log the user's vote of Agreement contract
        emit UserVote(msg.sender, usageID, dataUsage, consent);
    }
}

contracts/Lib.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

/**
data usage of actor.
*/
struct DataUsage {
    address  actorAddress;
    address  userAddress;
    string  serviceName;
    string servicePurpose;
    string  operation;
    // ["name", "gender", "address"]
    string[]  personalData;
}

/**
Represent user's vote for data usage by an actor.
*/
struct Vote {
    address actorAddress;
    address userAddress;
    uint usageID;
    bool consent;
}

/**
Represent the log of processed persoanl data by an actor
*/
struct LogContent {
    uint logID;
    address actorAddress; 
    address userAddress;
    uint usageID;
    string serviceName;
    string operation;
    // ["name", "gender"]
    string[] processedData;
}

struct VerifiedResult {
    uint logID;
    // if violator is a valid actor address, it means this actor is a violator. otherwise, this log is passed the verification.
    address violator;
}

contracts/SC_DataUsage.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;
import "./Lib.sol";

/** 
* Actor use some data of a User Subject, generate the smart contract
 */
contract DataUsageContract {

    address private creator;
    uint private usageID = 0;
    mapping(uint => DataUsage) private dataUsages;

    
    // event for EVM logging
    event UseData(address indexed actorAddress, address indexed userAddress, uint indexed usageID, DataUsage dataUsage);
    
    /**
     * @dev generate a new contract
     */
    constructor() {
        creator = msg.sender; // 'msg.sender' is sender of current call, contract deployer for a constructor
    }

    /**
    *  Using this address, an actor can access the contract and execute function (Gα) based on its purpose of data processing.
    */
    function useData(address userAddress, string memory serviceName, string memory servicePurpose, string memory operation, string[] memory personalData) public returns (uint) {
        address actorAddress = msg.sender;
        DataUsage memory dataUsage = DataUsage(actorAddress, userAddress, serviceName, servicePurpose, operation, personalData);       
        usageID++;
        dataUsages[usageID] = dataUsage;

        // Log the deployment of DataUsage contract
        emit UseData(actorAddress, userAddress, usageID, dataUsage);

        return usageID;
    }

    /**
     * @dev get the data usage
     */
    function retrieveDataUsage(uint _usageID) public view returns (DataUsage memory){
        return dataUsages[_usageID];
    }

    /**
     * @dev get the current contract address
     */
    function getContractAddress() public view returns (address) {
        return address(this);
    }
}

